val sqlFormat = new SimpleDateFormat("yyyy-MM-dd")
val humanFormat = new SimpleDateFormat("MM/dd/yyyy")

def toFormat(dateString: String, inFormat: DateFormat, outFormat: DateFormat) = outFormat.format(inFormat.parse(dateString))

def toSqlFormat(dateString: String) = toFormat(dateString, humanFormat, sqlFormat)
def toHumanFormat(dateString: String) = toFormat(dateString, sqlFormat, humanFormat)

val start = humanFormat.format(sqlFormat.parse(sqlContext.sql(
    "select min(hireDate) from employee").head.getString(0)))
val end = humanFormat.format(sqlFormat.parse(sqlContext.sql(
    "select max(activeTo) from employee_salary where activeTo < '9999-01-01'").head.getString(0)))

val maxDate = humanFormat.parse(z.input("Max Date:", end).toString)
val minDate = humanFormat.parse(z.input("Min Date:", start).toString)

val days = Iterator.iterate(minDate){
    (d) => new Date(d.getTime() + 2419200000l)
}.takeWhile(_.compareTo(maxDate) == -1).map(sqlFormat.format(_:Date))
    
sc.parallelize(days.toSeq).toDF.registerTempTable("days")
z.run("20170613-230643_1017913076")

